import React, { Component } from 'react'
import Product from './Product'
import Title from './Title'
export default class ProductList extends Component {

   state= {
   	 products:[]
   }

   render() {
     return (
         <React.Fragment> 

           <div className="py-5">
	           <div className="container">
	           	 <div className="row">
	           	   <div className="container">
	           	     <Title name="our" title="products" />
	               </div>
	             </div>
	           </div>
           </div>

         </React.Fragment> 

     ) 
   }

}
